import React from 'react';

const Nav = () => {

    return(
        <div>
            <nav>
                {/* top left of navbar */}
                <div className='leftNav'>
                    <img alt='' src='apple.png'></img>
                    <div>Finder</div>
                    <div className='middleLeftNav'>
                        <div>Edit</div>
                        <div>View</div>
                        <div>Go</div>
                        <div>Window</div>
                    </div>
                    <div>Home</div>
                </div>
                {/* top right of navbar */}
                <div className='rightNav'>
                <img src='./search.png' alt=''></img>   
                </div>
            </nav>
        </div>
    )
}

export default Nav;
